import React from 'react';
import { NavLink } from 'react-router-dom';
import './Cart.scss';

export const Cart = () => (
  <NavLink className="Cart Section" to="/cart">
    <div className="Section-Content">
      <img
        className="Section-Link"
        src="./img/cart.svg"
      />
      <span className="Section-Count">{}</span>
    </div>
  </NavLink>
)
